import React from "react";
import BasicItemsPage from "./BasicItemsPage";

import mealImage from "../images/burger_fries.png";

const MealPage = () => {
  return(
    <div>
      <BasicItemsPage displayInfo={displayInfo} isButton={true}/>
    </div>
  );
}

const displayInfo = [
  {
    title: "Southern Fried Chicken",
    price: "$20.00",
    image: mealImage,
    url: "/menu_item"
  },
  {
    title: "Road-Side Burger",
    price: "$12.00",
    image: mealImage,
    url: "/menu_item"
  },
  {
    title: "Srimp Crits",
    price: "$20.00",
    image: mealImage,
    url: "/menu_item"
  },
  {
    title: "Mac & Cheese",
    price: "$5.00",
    image: mealImage,
    url: "/menu_item"
  }
];

export default MealPage;
